import React, { useEffect } from 'react';
import { useNavigate } from "react-router";
import teamLogo from './1ds.png'; // Import the local image

function Register() {
  const navigate = useNavigate();

  const navigateToHome = () => {
    window.location.href = '/';
  };

  const navigateToRegister = () => {
    navigate('/register');
  };

  useEffect(() => {
    fetch('http://localhost:5000/secret')
      .then(response => response.json())
      .then(data => {
        console.log('Secret key:', data.secretKey);
        const renderRecaptcha = () => {
          window.grecaptcha.render('recaptcha', {
            sitekey: data.secretKey || '6LcWM5EqAAAAAEhzy8LXcnwBF7H-fK3OspAdZHYw' // Fallback to hardcoded key
          });
        };
        if (window.grecaptcha) {
          window.grecaptcha.ready(renderRecaptcha);
        } else {
          const intervalId = setInterval(() => {
            if (window.grecaptcha) {
              clearInterval(intervalId);
              window.grecaptcha.ready(renderRecaptcha);
            }
          }, 100);
        }
      })
      .catch(error => {
        console.error('Error fetching secret key:', error);
      });
  }, []);

  useEffect(() => {
    const script = document.createElement('script');
    script.src = 'https://www.google.com/recaptcha/api.js';
    script.async = true;
    script.defer = true;
    document.body.appendChild(script);
    return () => {
      document.body.removeChild(script);
    };
  }, []);

  return (
    <>
      <header style={{ backgroundColor: '#eef1f3', display: 'flex', alignItems: 'center', fontFamily: '"Playwrite Hrvatska Lijeva", Arial, sans-serif', fontSize: '40px', margin: '20px 0' }}>
        <img src={teamLogo} alt="Team Logo" style={{ marginLeft: '50px', marginRight: '20px', width: '10%', height: '10%', cursor: 'pointer' }} onClick={navigateToHome} />
        <div style={{ flex: 1, textAlign: 'center' }}>
          <span style={{ cursor: 'pointer' }} onClick={navigateToHome}>Death Squad <span style={{ color: 'red' }}>Team</span></span>
        </div>
        <div style={{ width: '20%', height: '10%', display: 'flex', justifyContent: 'flex-end', alignItems: 'center', marginRight: '50px' }}>
          <button style={{ width: '115px', height: '36px', background: '#7347c1', padding: '0', margin: '0', fontSize: '15px', fontWeight: '500', color: '#fff', display: 'inline-block', boxShadow: '0 4px 30px rgba(0, 0, 0, 0.1)', transition: '0.3s ease', border: '5px solid #7347c1', borderRadius: '34px', position: 'relative', marginRight: '10px', cursor: 'pointer' }} onMouseEnter={(e) => e.currentTarget.style.background = '#5a36a1'} onMouseLeave={(e) => e.currentTarget.style.background = '#7347c1'} onClick={navigateToRegister}>
            Register
          </button>
          <button style={{ width: '115px', height: '36px', background: '#0674ec', padding: '0', margin: '0', fontSize: '15px', fontWeight: '500', color: '#fff', display: 'inline-block', boxShadow: '0 4px 30px rgba(0, 0, 0, 0.1)', transition: '0.3s ease', border: '5px solid #0674ec', borderRadius: '34px', position: 'relative', cursor: 'pointer' }} onMouseEnter={(e) => e.currentTarget.style.background = '#045bb5'} onMouseLeave={(e) => e.currentTarget.style.background = '#0674ec'}>
            Login
          </button>
        </div>
      </header>
      <style>
        {`
          ::-webkit-scrollbar {
            display: none;
          }
          html {
            -ms-overflow-style: none;  /* IE and Edge */
            scrollbar-width: none;  /* Firefox */
          }
        `}
      </style>
      <div className="cardify signup_form" style={{ display: 'flex', flexDirection: 'column', alignItems: 'center', justifyContent: 'center', height: '100vh', backgroundColor: '#eef1f3', overflow: 'hidden' }}>
        <div style={{ width: '450px', backgroundColor: '#fff', padding: '20px', borderRadius: '10px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)' }}>
          <div className="login--header" style={{ textAlign: 'center', marginBottom: '20px' }}>
            <h3>Tạo tài khoản</h3>
            <p>Hãy điền đầy đủ thông tin bên dưới để đăng ký tài khoản thành viên Death Squad Team</p>
          </div>
          <div className="login--form" style={{ width: '100%' }}>
            <div className="form-group" style={{ marginBottom: '20px' }}>
              <label htmlFor="hotentxt">Tên của bạn:</label>
              <input id="hotentxt" type="text" className="text_field" placeholder="Nhập tên của bạn" name="hoten" autoComplete="off" required style={{ padding: '10px', borderRadius: '5px', border: '1px solid #ccc', width: 'calc(100% - 20px)' }} />
              <span id="hotenerrortxt" className="text-danger" style={{ color: 'red', float: 'right', marginBottom: '20px', display: 'none' }}></span>
            </div>
            <div className="form-group" style={{ marginBottom: '20px' }}>
              <label htmlFor="emailtxt">Email:</label>
              <input id="emailtxt" type="text" className="text_field" placeholder="Nhập email của bạn" name="email" autoComplete="off" required style={{ padding: '10px', borderRadius: '5px', border: '1px solid #ccc', width: 'calc(100% - 20px)' }} />
              <span id="emailerrortxt" className="text-danger" style={{ color: 'red', float: 'right', marginBottom: '20px', display: 'none' }}></span>
            </div>
            <div className="form-group" style={{ marginBottom: '20px' }}>
              <label htmlFor="usernametxt">Tên đăng nhập:</label>
              <input id="usernametxt" type="text" className="text_field" placeholder="Nhập tên đăng nhập" name="username" autoComplete="off" required style={{ padding: '10px', borderRadius: '5px', border: '1px solid #ccc', width: 'calc(100% - 20px)' }} />
              <span id="usernameerrortxt" className="text-danger" style={{ color: 'red', float: 'right', marginBottom: '20px', display: 'none' }}></span>
            </div>
            <div className="form-group" style={{ marginBottom: '20px' }}>
              <label htmlFor="passtxt">Mật khẩu:</label>
              <input id="passtxt" type="password" className="text_field" placeholder="Nhập mật khẩu" name="pass" required style={{ padding: '10px', borderRadius: '5px', border: '1px solid #ccc', width: 'calc(100% - 20px)' }} />
              <span id="passerrortxt" className="text-danger" style={{ color: 'red', float: 'right', marginBottom: '20px' }}></span>
            </div>
            <div className="form-group" style={{ marginBottom: '20px' }}>
              <label htmlFor="repasstxt">Nhập lại mật khẩu</label>
              <input id="repasstxt" type="password" className="text_field" placeholder="Nhập lại mật khẩu" name="repass" required style={{ padding: '10px', borderRadius: '5px', border: '1px solid #ccc', width: 'calc(100% - 20px)' }} />
              <span id="repasserrortxt" className="text-danger" style={{ color: 'red', float: 'right', marginBottom: '20px', display: 'none' }}></span>
            </div>
            <div className="g-recaptcha" id="recaptcha" style={{ marginBottom: '20px' }}></div>
            <button className="btn btn--xs register_btn" type="submit" style={{ padding: '10px', borderRadius: '5px', border: 'none', backgroundColor: '#0674ec', color: '#fff', cursor: 'pointer', width: '100%' }}>Đăng ký</button>
            <div className="login_assist" style={{ textAlign: 'center', marginTop: '20px' }}>
              <p>Bạn đã có tài khoản thành viên ? <a href="/signin">Đăng nhập</a></p>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

export default Register;
